import io
import json
import base64
import openai
import PyPDF2

class DocumentIntelligence:
    
    def __init__(self, api_key):
        openai.api_key = api_key
    
    def chat_completion_response_format(self, prompt_template, content, gptmodel, response_format):
            prompt = [
                         {"role": "system", "content": f"{content}"},
                         {"role": "user", "content": f"{prompt_template}'"}
                     ]
            return openai.chat.completions.create(  
                model=gptmodel,  
                messages=prompt,
                response_format=response_format,
                temperature=0,
                top_p=0.2  
                ).choices[0].message.content
        
    def extract_text(self):
        # Reading a base64 PDF document using PyPDF2
        # Decode base64 string into bytes & assign it to variable
        base64String = ''
        content_bytes: bytes = base64.b64decode(base64String)
        pdfBytes = io.BytesIO(initial_bytes = content_bytes)
        pdfReader = PyPDF2.PdfReader(stream = pdfBytes)
        if pdfReader.is_encrypted:
           pdfReader.decrypt("")

        numberOfPages = len(pdfReader.pages)
        pageContent = ''
        for index in range(numberOfPages):
            currentPage = pdfReader.pages[index]
            pageContent += currentPage.extract_text()

        # Create prompt with fieldsToLookFor in the document, Fields can be anything from DocumentNumber, PageNo, Supplier, etc.'

        # We can always make the prompt strong in nature using different prompt engineering techniques. This is just a basic example to help you understand how to use a prompt

        prompt_template = 'Extract the data from the content for fields like Supplier, AgreementNumber, EffectiveDate. Make sure the JSON is always a serialized object & does not contain any comments or additional information. The JSON properties should not include any spaces or special characters in the property names.'

        # Response format is used to communicate model to always return response in JSON
        json_data= self.chat_completion_response_format(prompt_template, pageContent, 'gpt-3.5-turbo-1106', {"type": "json_object"})
        
        # Load JSON data
        data = json.loads(json_data)

        # Print loaded data
        print("Data:")
        print(data)
    
# Example usage
if __name__ == "__main__":
    api_key = ''
    document_intelligence = DocumentIntelligence(api_key)
    
    # Call your methods here as needed
    document_intelligence.extract_text()